    // Label values should match CSS classes
    const L_RED = 'red';
    const L_BLUE = 'blue';
    let cur_idx = 0;
    let page = 0;
    const PAGE_SIZE = 1000;
    let examples = {};
    function init_examples() {
      for (let i in files) {
        const file = files[i];
        let label = L_RED;
        if (file.label === '1.0') {
          label = L_BLUE;
        }
        examples[file.filename] = {
          label: label
        };
      }
    }

    function init_elements() {
      const $container = document.getElementById('container');
      let keys = Object.getOwnPropertyNames(examples);
      if (keys.length > PAGE_SIZE) {
        keys = keys.slice(PAGE_SIZE * page, PAGE_SIZE * (page+1));
      }
      for (let i in keys) {
        const filename = keys[i];
        let $img = document.createElement('img');
        const example = examples[filename];
        example.$img = $img;
        $img.setAttribute('data-filename', filename);
        $img.setAttribute('src', filename);
        $img.onclick = () => toggle_label($img);
        update_class($img);
        $container.appendChild($img);
      }
    }

    function update_class($img) {
      const example = get_example($img);
      const filename = $img.getAttribute('data-filename');
      let class_name = example.label;
      if (files[cur_idx].filename === filename) {
        class_name += ' selected';
      }
      $img.setAttribute('class', class_name);
    }

    function get_example($img) {
      const filename = $img.getAttribute('data-filename');
      const example = examples[filename];
      return example;
    }

    function toggle_label($img) {
      const example = get_example($img);
      let new_label = L_RED;
      if (example.label === L_RED) {
        new_label = L_BLUE;
      }
      example.label = new_label;
      update_class($img);
    }

    function init() {
      init_examples();
      init_elements();

      document.onkeydown = handle_keydown;
    }

    function log_csv() {
      let out = '';
      for (let filename in examples) {
        const label = examples[filename].label;
        out += `${filename},${label}\n`;
      }
      const $output = document.getElementById('output');
      $output.innerHTML = out;
    }

    function handle_keydown(e) {
      const LEFT = 37;
      const RIGHT = 39;
      const SPACE = 32;
      switch (e.keyCode) {
      case LEFT:
        // set_current_label(L_RED);
        break;
      case RIGHT:
        select_next();
        e.preventDefault();
        break;
      case SPACE:
        toggle_current_label();
        e.preventDefault();
        break;
      }
    }

    function set_current_label(label) {
      const file = files[cur_idx];
      const example = examples[file.filename];
      example.label = label;
      select_next();
      update_class(example.$img);
    }

    function toggle_current_label() {
      const file = files[cur_idx];
      const example = examples[file.filename];
      toggle_label(example.$img);
    }

    function select_next() {
      const pv_file = files[cur_idx];
      const pv_example = examples[pv_file.filename];
      cur_idx += 1;
      const nx_file = files[cur_idx];
      const nx_example = examples[nx_file.filename];
      update_class(nx_example.$img);
      update_class(pv_example.$img);
    }
  </script>
<body>
  <div id="container"></div>
  <button onclick="javascript:log_csv()">Log CSV</button>
  <textarea id="output"></textarea>
  <script>
    init();
  </script>
